import { useState } from 'react';

const Navbar = () => {
  const [isActive, setIsActive] = useState(false);

  const handleClick = () => {
    setIsActive(!isActive);
    console.log("Clicked menu");
  };

  return (
    <div>
      <div className={`navTrigger ${isActive ? 'active' : ''}`} onClick={handleClick}>
        {/* Your menu icon here, for example, a hamburger icon */}
        <span></span>
        <span></span>
        <span></span>
      </div>
      <div id="mainListDiv" className={`mainListDiv ${isActive ? 'show_list' : ''}`}>
        {/* Your list items here */}
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
